import './App.css';

function App() {
	return (
		<div className="App">
			<div className='header'>
				<div>logo</div>
				<div>navbar <BsFillArrowDownCircleFill size='80px' /></div>
			</div>
			<div className='left-block'>search + active contact</div>
			<div className='right-block'>messages</div>
		</div>
	);
}

export default App;
